// frontend/src/App.js
import React from 'react';
import DropdownMenu from './components/DropdownMenu';
import AssetForm from './components/AssetForm';
import AssetListPanel from './components/AssetListPanel';
import './styles/App.css';

const App = () => {
  return (
    <div
      className="background"
      style={{
        backgroundImage: `url(${process.env.PUBLIC_URL + '/CySecAssureBG.jpeg'})`,
        backgroundSize: 'cover',
        backgroundAttachment: 'fixed',
        backgroundColor: '#cccccc' // Fallback color to check if background is the issue
      }}
    >
      <div className="overlay">
        <h1 style={{ color: 'black' }}>Welcome to CySecAssure</h1> {/* Temporary heading */}
        <DropdownMenu />
        <AssetForm />
        <AssetListPanel />
      </div>
    </div>
  );
};

export default App;
